};
const LoaderStyle = {
    border: "1px solid black",
    display: "inline-block",
};
const MEMES = [
    {
        title: "Mem1",
        upvotes: 6,
        downvotes: 0,
        img: "mem1.jpeg",
    },
    {
        title: "Mem2",
        upvotes: 6,
        downvotes: 0,
        img: "mem2.jpeg",
    },
];

export const Memlist = () => {
    return (
        <div>


            {MEMES.map((mem) => {
                return (
                    <div>
                        <img
                            src={process.env.PUBLIC_URL + '/' + mem.img} alt="logo"
                            style={{ ...TileStyle, ...ImageStyle, ...LoaderStyle }}
                        />
                        <div>
                            <button onClick={''}>+ {mem.upvote}</button>
                            <button onClick={''}>- {}</button>
                        </div>
                    </div>
                    // <img src="images/mem1.jpeg" alt="mem1" />
